import React, { Component } from 'react';
import Header from '../header/header';
import CardsPreview from './Types/CardsPreview'; 
import  './Cards.css';
import CardBg from '../../images/Card_Container.png'

class Cards extends Component {
    constructor(props) {
        super(props)
        this.state = {
            header: [
                { title: 'Cards & Payments' }
            ],
        }
    }
    render() {
        return (
            <div className="wrapper">
                <section className="container">
                    <div className="row">
                        <Header header={this.state.header[0].title} />  
                        <div className="row w-100">
                            <div className="col-md-12 mb-30">
                                <div className="h5 mb-20">Cards Preview</div>
                                <div className="row">
                                    <CardsPreview 
                                        title1="current balance" 
                                        price="$3 458.90" 
                                        icon="Visa" 
                                        background="#1a1f71" 
                                        borderRadius="8px" 
                                        boxShadow="0 1px 3px rgba(0, 0, 0, 0.3)" 
                                        title2="Benjamin Parker" cardNo="rewftdxvgds" date="03/24" className="cards flex-div" width="100%" height="200px"/>
                                    <CardsPreview title1="current balance" price="$3 458.90" icon="Visa" background="#eee" borderRadius="8px" boxShadow="0 1px 3px rgba(0, 0, 0, 0.3)" title2="Benjamin Parker" cardNo="4321 0987 0000 9876" date="03/24" className="cards flex-div" width="100%" height="200px"/>
                                    <CardsPreview title1="current balance" price="$3 458.90" icon="Visa" background="#1a1f71" borderRadius="8px" boxShadow="0 1px 3px rgba(0, 0, 0, 0.3)" title2="Benjamin Parker" cardNo="4321 0987 0000 9876" date="03/24" className="cards flex-div" width="100%" height="200px"/>
                                </div>
                            </div>
                        </div>
                    </div>
                </section>
            </div>
        );
    }
}

export default Cards;
